DELETE FROM pate_cuentas WHERE cuen_cuenta IS NULL AND cuen_descripcion IS NULL;
ALTER TABLE pate_cuentas MODIFY (cuen_cuenta NOT NULL, cuen_descripcion NOT NULL);
ALTER TABLE pate_cuentas ADD cuen_tipo VARCHAR(20) ;

CREATE OR REPLACE TRIGGER TRG_PATE_CUENTAS_ID 
BEFORE INSERT OR UPDATE ON PATE_CUENTAS
FOR EACH ROW 
BEGIN
  IF INSERTING THEN
    :NEW.CUEN_ID := SEQ_PATE_CUENTAS.NEXTVAL;
    :NEW.CUEN_FECHAADD := SYSDATE;
  ELSIF UPDATING THEN 
    :NEW.CUEN_FECHAMOD := SYSDATE;
  END IF;
END;

