-- DROP TABLE pate_codigos_dane;
-- DROP SEQUENCE seq_pate_codigos_dane;

CREATE TABLE pate_codigos_dane (
  id NUMBER(5) PRIMARY KEY,
  departamento_codigo VARCHAR2(10) NOT NULL,
  departamento_nombre VARCHAR2(100) NOT NULL,
  municipio_codigo VARCHAR2(10) NOT NULL,
  municipio_nombre VARCHAR2(100) NOT NULL,
  codigo_dane VARCHAR2(20) NOT NULL,
  fecha_add DATE,
  fecha_mod DATE
);

CREATE SEQUENCE seq_pate_codigos_dane  
MINVALUE 1 
MAXVALUE 9999999999999999999999999999 
INCREMENT BY 1 
START WITH 1 
NOCACHE  
NOORDER  
NOCYCLE ;

CREATE OR REPLACE TRIGGER trg_pate_codigos_dane 
BEFORE INSERT OR UPDATE ON pate_codigos_dane  
FOR EACH ROW
BEGIN
  IF INSERTING THEN
    :NEW.id := seq_pate_codigos_dane.NEXTVAL;
    :NEW.fecha_add := SYSDATE;
  ELSIF UPDATING THEN 
    :NEW.fecha_mod := SYSDATE;
  END IF;
END;

